import {
	Text,
	Flex,
	TableContainer,
	Tab,
	Table,
	Thead,
	Tr,
	Th,
	Tbody,
} from '@chakra-ui/react';
import { useEffect, useState } from 'react';

export const App = () => {
	const [data, setData] = useState(null);

	const getData = () => {
		fetch('/data')
			.then((d) => d.json())
			.then((data) => {
				const key = Object.keys(data)[0];
				console.log(data[key]);
			});
	};
	useEffect(() => {
		getData();
	}, []);
	return (
		<Flex alignItems="center" justify="center" w="100vw" minHeight="100vh">
			<Text position="absolute" top="5vh" fontWeight="semibold" fontSize="18">
				S&P 500 Index Data
			</Text>
		</Flex>
	);
};

const DataTable = ({ data }) => {
	return (
		<TableContainer>
			<Table>
				<Thead>
					<Tr>
						<Th></Th>
					</Tr>
				</Thead>

				<Tbody></Tbody>
			</Table>
		</TableContainer>
	);
};
